import React, { useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import axios from "axios";

const CrewInfo = () => {
  const [crew, setCrew] = useState([]);
  const { id } = useParams();
  console.log(id);
  useEffect(() => {
    axios.get(`https://api.spacexdata.com/v4/crew/${id}`).then((response) => {
      console.log(response.data);
      setCrew(response.data);
    });
  }, [id]);
  return (
    <div className="container" style={{ marginTop: "40px" }}>
      <div className="row">
        <div className="col-sm-6">
          <h1>crew</h1>
          <img src={crew.image} className="img" style={{width:"450px"}}/>
        </div>
        <div className="col-sm-3 my-5 text-light">
          <h1>{crew.name}</h1>
          <p>agency:{crew.agency}</p>
          <button className = "btn btn-light-outline">Wikipedia</button>
        </div>
      </div>
    </div>
  );
};

export default CrewInfo;
